import React from 'react';
import './login.css'


const login =(props)=>{
    return (
        <div className='container'>
          <form>
            <label>Name :</label>
            <input  
                type="text"
                name="Name"
                onChange={props.changeHandler}
                value={props.name}
            ></input>
            <br></br>
            <label>Password :</label>
            <input
                type="password"
                name="Password"
                onChange={props.changeHandler}
                value={props.Password}  
            ></input>
            <br></br>
            <button onClick ={props.click}>Submit</button>
          </form>
        </div>
    );
}

export default login;
